--insert timekeeping
declare @i int = 1;
declare @Date datetime = cast('2023-05-01' as datetime);
declare @totalUser int = (select count(*) from Employee);
while @i <= @totalUser
begin
	declare @UserId uniqueidentifier = (select [Id] from (select row_number() over(order by [FullName] asc) as row, * from Employee where [Status] = 3 and [LeaveDate] is null) c where row = @i);
	declare @j int = 0;
	while @j < 89
		begin
			values (newid(),@UserId,DATEADD(DAY,@j,@Date),'00000000-0000-0000-0000-000000000000',DATEADD(HOUR,8,DATEADD(DAY,@j,@Date)),DATEADD(HOUR,19,DATEADD(DAY,@j,@Date)), DATEADD(DAY,@j,@Date), 0, 0, 'data:image/jpeg;base64,','data:image/jpeg;base64,')
			set @j = @j + 1;
		end
set @i = @i + 1;
end